import React, { Component } from 'react';

export default class App extends Component {
  constructor() {
    super();
    this.state = {
      count: 1,
    };
  }
  render() {
    return (
      <div>
        <h1>{this.state.count}</h1>
        <button onClick={this.increment}>增加</button>
      </div>
    );
  }

  increment = () => {
    this.setState({
      count: this.state.count + 1,
    });
  };
}
